import "./navbar.css";
import { useState } from "react";
import { Link } from "react-router-dom";
function Navbar() {
  const [open, setOpen] = useState(false);

  const user = false;
  function togglePopup() {
    var popup1 = document.getElementById("popup-1");
    var popup2 = document.getElementById("popup-2");

    popup1.classList.toggle("active");
    if (popup2.classList.contains("active")) {
      popup2.classList.remove("active");
    }
  }

  function togglePopup1() {
    var popup1 = document.getElementById("popup-1");
    var popup2 = document.getElementById("popup-2");

    popup2.classList.toggle("active");
    if (popup1.classList.contains("active")) {
      popup1.classList.remove("active");
    }
  }

  // Register Functionality
  function register() {
    var name = document.getElementById("registerName").value;
    var phoneNumber = document.getElementById("registerPhoneNumber").value;
    var email = document.getElementById("registerEmail").value;
    var password = document.getElementById("registerPassword").value;

    if (name === "" || phoneNumber === "" || email === "" || password === "") {
      alert("Please fill in all fields");
      return;
    }

    var num = /^[789]\d{9}$/;
    if (!phoneNumber.match(num)) {
      alert("Invalid Phone Number");
      return false;
    }

    var mailformat = /^[a-z0-9]+@[a-z]+\.[a-z]{2,3}$/;
    if (!email.match(mailformat)) {
      alert("Invalid email");
      return false;
    }

    var userData = {
      name: name,
      phoneNumber: phoneNumber,
      email: email,
      password: password,
    };

    localStorage.setItem(email, JSON.stringify(userData));

    alert("Registration successful");
    togglePopup();
  }

  // Login Functionality
  function login() {
    var email = document.getElementById("loginEmail").value;
    var password = document.getElementById("loginPassword").value;

    var userData = JSON.parse(localStorage.getItem(email));

    if (userData && userData.password === password) {
      alert("Login successful");
      localStorage.setItem("isLoggedIn", "true");
      document.getElementById("logoutButton").style.display = "inline";
      document.getElementById("loginBtn").style.display = "none";
    } else {
      alert("Invalid email or password");
    }
    togglePopup();
  }

  // Logout Functionality
  function logout() {
    document.getElementById("logoutButton").style.display = "none";
    document.getElementById("loginEmail").value = "";
    document.getElementById("loginPassword").value = "";
    document.getElementById("loginBtn").style.display = "inline";
    localStorage.setItem("isLoggedIn", "false");
    alert("You are now logged out!");
    togglePopup();
  }

  function initializePage() {
    var isLoggedIn = localStorage.getItem("isLoggedIn");
    if (isLoggedIn === "true") {
      document.getElementById("logoutButton").style.display = "inline";
      document.getElementById("loginBtn").style.display = "none";
    } else {
      document.getElementById("logoutButton").style.display = "none";
      document.getElementById("loginBtn").style.display = "inline";
    }
  }

  // Call the initialization function when the page loads
  window.onload = initializePage;

  return (
    <nav>
      <div className="left">
        <a href="/" className="logo">
          <img src="/logo.png" alt="" />
          <span>HomeHaven</span>
        </a>
        <a href="/">Home</a>
        <a href="/about">About</a>
        <a href="/">Contact</a>
        <a href="/list">Listings</a>
      </div>
      <div className="right">
        {user ? (
          <div className="user">
            <img
              src="https://images.pexels.com/photos/91227/pexels-photo-91227.jpeg?auto=compress&cs=tinysrgb&w=1260&h=750&dpr=2"
              alt=""
            />
            <span>John Doe</span>
            <Link to="/profile" className="profile">
              <div className="notification">3</div>
              <span>Profile</span>
            </Link>
          </div>
        ) : (
          <>
            <div id="popup-1" class="popup" style="display: block;">
              <div class="content">
                <div class="close-btn" onclick="togglePopup()">
                  x
                </div>
                <p class="log1">
                  Log In to{" "}
                  <span style="font-weight: bold; color: #178F7A">
                    Recipe Realm
                  </span>
                </p>
                <div class="input-field">
                  <input
                    id="loginEmail"
                    placeholder="Email"
                    class="validate"
                    type="email"
                  />
                </div>
                <div class="input-field">
                  <input
                    id="loginPassword"
                    type="password"
                    placeholder="Password"
                    class="validate"
                  />
                </div>
                <button class="second-button" onclick="login()">
                  Log In
                </button>
                <p>
                  Don't have an account?{" "}
                  <a onclick="togglePopup1()">
                    <span style="color: blue; cursor: pointer;text-decoration: underline;">
                      Register
                    </span>
                  </a>
                </p>
              </div>
            </div>

            <div class="popup" id="popup-2">
              <div class="content" style="height: 600px; top: 400px;">
                <div class="close-btn" onclick="togglePopup1()">
                  x
                </div>

                <p class="log1">
                  Create Your{" "}
                  <span style="font-weight: bold; color: #178F7A">
                    Recipe Realm
                  </span>{" "}
                  Account
                </p>
                <div class="input-field">
                  <input
                    id="registerName"
                    placeholder="Name"
                    class="validate"
                  />
                </div>
                <div class="input-field">
                  <input
                    id="registerPhoneNumber"
                    placeholder="Phone Number"
                    class="validate"
                  />
                </div>
                <div class="input-field">
                  <input
                    id="registerEmail"
                    placeholder="Email"
                    class="validate"
                    type="email"
                    required
                  />
                </div>
                <div class="input-field">
                  <input
                    id="registerPassword"
                    placeholder="Password"
                    class="validate"
                  />
                </div>
                <button class="second-button" onclick="register()">
                  Register
                </button>
                <p>
                  Already have an account?{" "}
                  <a onclick="togglePopup()">
                    <span style="color: blue; cursor: pointer; text-decoration: underline;">
                      Login
                    </span>
                  </a>
                </p>
              </div>
            </div>

            <li>
              <a
                onclick="togglePopup()"
                id="loginBtn"
                style="margin-left:-30px;cursor: pointer;">
                Login
              </a>
            </li>
            <button
              id="logoutButton"
              style="display: none;"
              onclick="logout()"
              class="logout">
              Logout
            </button>
          </>
        )}
        <div className="menuIcon">
          <img
            src="/menu.png"
            alt="menu icon"
            onClick={() => setOpen((prev) => !prev)}
          />
        </div>
        <div className={open ? "menu active" : "menu"}>
          <a href="/">Home</a>
          <a href="/">About</a>
          <a href="/">Contact</a>
          <a href="/">Agents</a>
          <a href="/">Sign In</a>
          <a href="/">Sign Up</a>
        </div>
      </div>
    </nav>
  );
}

export default Navbar;
